  "extra" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>extra</b> <i>&lt;task&gt;</i> <i>@Optional</i></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L3:0-3:21"];
  "mandatory" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>mandatory</b> <i>&lt;task&gt;</i> <i>@Required</i></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L4:0-4:25"];

}
